import React from "react";
import homepage from "./data";
import image from "./img/finally.jpg";
import { Link } from "react-router-dom";

const Home = () => {
  return (
    <div
      style={{
        display: "flex",
        flexDirection: "column",
        alignItems: "center",
        padding: "2rem",
        marginTop: 50,
        minHeight: "100vh",
        background: "linear-gradient(135deg, #f5f5f5, #e0e0e0)", // Gradient background
      }}
    >
      {/* Hero Section */}
      <div
        style={{
          position: "relative",
          width: "100%",
          maxWidth: "1200px",
          height: "400px",
          borderRadius: 15,
          overflow: "hidden",
          boxShadow: "0 4px 10px rgba(0,0,0,0.3)",
          marginBottom: "2rem",
        }}
      >
        <img
          src={image}
          style={{
            width: "100%",
            height: "100%",
            objectFit: "cover",
            filter: "blur(1px)",
          }}
          alt="Luxora Background"
        />
        <div
          style={{
            position: "absolute",
            top: "50%",
            left: "50%",
            transform: "translate(-50%, -50%)",
            textAlign: "center",
            color: "white",
            padding: "1rem",
            background: "rgba(0,0,0,0.6)", // Dark overlay for text
            borderRadius: 10,
            transition: "background 0.5s ease",
          }}
        >
          <h1
            style={{
              fontSize: "3rem",
              fontWeight: "700",
              margin: 0,
            }}
          >
            Discover a New Shopping Experience
          </h1>
        </div>
      </div>

      {/* Products Section */}
      <div
        style={{
          width: "100%",
          maxWidth: "1200px",
          marginBottom: "2rem",
          textAlign: "center",
        }}
      >
        <h1
          style={{
            fontSize: "2rem",
            color: "#333",
          }}
        >
          Products & <span style={{ color: "#e63946" }}>Details</span>
        </h1>
        <p
          style={{
            fontSize: "1.1rem",
            color: "#555",
            margin: "1rem 0 2rem",
          }}
        >
          Explore our exclusive collection and find your favorites.
        </p>
        <div
          style={{
            display: "flex",
            flexWrap: "wrap",
            justifyContent: "center",
            gap: "2rem",
          }}
        >
          {homepage.map((item, index) => (
            <div
              key={`container-${index}`}
              style={{
                width: "300px",
                borderRadius: 10,
                boxShadow: "0 4px 12px rgba(0,0,0,0.1)",
                backgroundColor: "white",
                overflow: "hidden",
                textAlign: "center",
                transition: "transform 0.3s, box-shadow 0.3s",
                cursor: "pointer",
                ":hover": {
                  transform: "scale(1.05)",
                  boxShadow: "0 8px 15px rgba(0,0,0,0.3)",
                },
              }}
            >
              <img
                src={item.url}
                alt={item.alt}
                style={{
                  width: "100%",
                  height: "200px",
                  objectFit: "cover",
                }}
              />
              <div
                style={{
                  padding: "1rem",
                }}
              >
                <p
                  style={{
                    fontSize: "1rem",
                    color: "#333",
                  }}
                >
                  {item.content}
                </p>
                <Link
                  to={item.alt}
                  style={{
                    display: "flex",
                    alignItems: "center",
                    justifyContent: "center",
                    backgroundColor: "#e63946",
                    color: "white",
                    padding: "0.5rem 1.5rem",
                    borderRadius: 30,
                    textDecoration: "none",
                    fontWeight: "600",
                    fontSize: "1rem",
                    marginTop: "1rem",
                    transition: "background-color 0.3s ease",
                    ":hover": {
                      backgroundColor: "#d62839",
                    },
                  }}
                >
                  <span>Shop Now</span>
                  <img
                    src="https://cdn-icons-png.flaticon.com/128/8213/8213451.png"
                    style={{
                      height: 20,
                      width: 20,
                      marginLeft: 10,
                    }}
                    alt="Arrow Icon"
                  />
                </Link>
              </div>
            </div>
          ))}
        </div>
      </div>

      {/* Footer Section */}
      <footer
        style={{
          textAlign: "center",
          padding: "1rem",
          fontSize: "0.9rem",
          color: "#666",
        }}
      >
        <h2>
          &copy; 2024{" "}
          <Link
            to="https://github.com/sivaprasath2004"
            style={{ color: "#e63946" }}
          >
            sivaprasath2004
          </Link>
        </h2>
      </footer>
    </div>
  );
};

export default Home;

